  wkof.include("ItemData,Menu,Settings");
  wkof.ready("Menu,Settings").then(startup).catch(loadError);

  function loadError(e) {
    console.error(`Startup for "${ScriptName}" failed`, e);
  }

  function startup() {
    installCSS();

    const promises = [wkof.ready("Menu"), loadDB(), loadSettingsAndMenu()];
    if (window.location.href.includes("subject-lessons/picker")) {
      promises.push(wkof.ready("ItemData").then(loadItems));
    }

    const observer = new MutationObserver(() => {
      postNavigate();
    });

    Promise.all(promises)
      .then(postNavigate)
      .then(() => {
        observer.observe(document.body, { childList: true, subtree: false });
      });
  }

  function loadDB() {
    if (wkof.file_cache.dir[ScriptId]) {
      return wkof.file_cache.load(ScriptId).then((data) => {
        if (!data) {
          data = new Set();
        }
        shared.markedVocab = data;
      });
    } else {
      shared.markedVocab = new Set();
      return Promise.resolve();
    }
  }

  function loadSettingsAndMenu() {
    let defaults = {
      rankCutoff: 2500,
      source: "a",
      showRankDuringReviews: false,
    };
    return wkof.Settings.load(ScriptId, defaults).then(() => {
      shared.settings = wkof.settings[ScriptId];
      if (!window.location.href.includes("subject-lessons/picker")) {
        wkof.Menu.insert_script_link({
          name: ScriptId,
          submenu: "Settings",
          title: ScriptName,
          on_click: openSettings,
        });
      }
    });
  }

  function loadItems() {
    const vocabConfig = { wk_items: { options: { subjects: true }, filters: { srs: "init", item_type: ["voc", "kana_voc"] } } };
    wkof.ItemData.get_items(vocabConfig).then((items) => {
      const subjectsById = wkof.ItemData.get_index(items, "subject_id");
      shared.vocab = subjectsById;
    });
  }

